import CardList from "./CardList";
import {robots} from "./Robots";
import SearchBar from "./SearchBar";
import React, {Component} from "react";


class App extends Component {
    constructor(){
        super()
        this.state = {
            robots: robots,
            searchBar: ""
            } 
        }
    render () {
        return (
            <div className="tc">
                <h1>RoboFriends</h1>
                <SearchBar />
                <CardList robots={robots}/>
            </div>
        );
    }
};

export default App
